      integer iregion
      integer getMap
      external getMap

      real orig1(3),rmat1(3,3)
      data orig1/0,0,-1975/
      data rmat1/1,0,0,
     +          0,6.12303e-17,-1,
     +          0,1,6.12303e-17/
      real orig2(3),rmat2(3,3)
      data orig2/0,0,-1345/
      data rmat2/1,0,0,
     +          0,6.12303e-17,-1,
     +          0,1,6.12303e-17/
      real orig3(3),rmat3(3,3)
      data orig3/0,0,0/
      data rmat3/1,0,0,
     +          0,1,0,
