        B(1) = 0
        B(2) = -2
        B(3) = 1.22461e-16
      else if (iregion.eq.2) then
        B(1) = 0
        B(2) = -2
        B(3) = 1.22461e-16
      else if (iregion.eq.3) then
		    call gufld2(r, B)
C        rs(1) = r(1)-orig3(1)
C        rs(2) = r(2)-orig3(2)
C        rs(3) = r(3)-orig3(3)
